import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import { Container, Navbar, Nav, Button, Row, Col } from 'react-bootstrap';
import CategoryPage from './pages/CategoryPage';
import ProductPage from './pages/ProductPage';
import CustomerPage from './pages/CustomerPage';  // Tạo thêm CustomerPage nếu cần
import HomePage from './pages/HomePage';  // Trang Home
import LoginPage from './pages/LoginPage'; // Thêm trang LoginPage
import './App.css';  // Thêm file CSS tùy chỉnh

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [isAdmin, setIsAdmin] = useState(false);  // Thêm state isAdmin để kiểm tra vai trò

  // Kiểm tra trạng thái đăng nhập và vai trò khi trang web load
  useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      const userRole = localStorage.getItem('role');  // Lấy vai trò từ localStorage sau khi đăng nhập
      setIsLoggedIn(true);
      setIsAdmin(userRole === 'Admin User');  // Kiểm tra nếu vai trò là 'Admin User'
    }
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('token'); // Xóa token khi logout
    localStorage.removeItem('role');  // Xóa vai trò khi logout
    sessionStorage.clear();
    setIsLoggedIn(false);
    setIsAdmin(false);  // Đặt lại trạng thái isAdmin
  };

  return (
    <Router>
      <div>
        {/* Navbar với các menu và nút login/logout */}
        <Navbar bg="dark" variant="dark" expand="lg">
          <Container>
            <Navbar.Brand href="/" className="ecommerce-brand">Ecommerce Admin</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="me-auto">
                <Nav.Link as={Link} to="/" className="nav-link">Home</Nav.Link>

                {/* Hiển thị các menu chỉ khi người dùng là Admin */}
                {isAdmin && (
                  <>
                    <Nav.Link as={Link} to="/customers" className="nav-link">View Customers</Nav.Link>
                    <Nav.Link as={Link} to="/categories" className="nav-link">Manage Categories</Nav.Link>
                    <Nav.Link as={Link} to="/products" className="nav-link">Manage Products</Nav.Link>
                  </>
                )}
              </Nav>
              <Nav.Link as={Link} to="/login">
                {/* Nút Login hoặc Logout */}
                {isLoggedIn ? (
                  <Button variant="danger" onClick={handleLogout}>Logout</Button>
                ) : (
                  <Button variant="primary">Login</Button>
                )}
              </Nav.Link>
            </Navbar.Collapse>
          </Container>
        </Navbar>

        {/* Routes */}
        <Container className="mt-4">
          <Row>
            <Col>
              <Routes>
                <Route path="/" element={<HomePage />} />
                <Route path="/customers" element={<CustomerPage />} />
                <Route path="/categories" element={<CategoryPage />} />
                <Route path="/products" element={<ProductPage isLoggedIn={isLoggedIn} />} />
                <Route path="/login" element={<LoginPage setIsLoggedIn={setIsLoggedIn} setIsAdmin={setIsAdmin} />} />
              </Routes>
            </Col>
          </Row>
        </Container>
      </div>
    </Router>
  );
}

export default App;
